<!DOCTYPE html>
<head>
	<meta charset="UTF-8" http-equiv="200" />
	<title>Page Manager</title>

	<script src="../libs/webcirque/websf/main.catalyst.js"></script>

	<div class="se se-max panel">

			<div class="tab-unit" id="tab-icon-audioPanel">
				<img class="icon-play isize-sm" title="$!base.audioPanel" />
			</div>
			<div class="tab-unit" id="tab-icon-open">
				<img class="icon-play isize-sm" title="$!base.open" />
			</div>
			<div class="tab-unit" id="tab-icon-conf">
				<img class="icon-play isize-sm" title="$!base.conf" />
			</div>
		</div>
